  let [count, setCount] = useState(0)
  
  return (
    <div>
      <p>{count}</p>
      <button className='btn btn-primary mt-4 m-3'>Add</button>
      <button className='btn btn-primary mt-4 m-3'>Subtract</button>
    </div>
  )
}
